// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

contract Donation {
    address public owner;
    uint public totalDonations; // Track total donations

    enum Category { Agriculture, ChildrenFood, Studies, Homeless }
    mapping(address => uint) public donorBalances;
    mapping(Category => uint) public categoryDonations; // Donations by category

    // Define events
    event DonationReceived(address donor, uint amount, Category category);
    event FundsWithdrawn(address owner, uint amount);

    constructor() {
        owner = msg.sender; // Contract owner
    }

    // Function to accept donations
    function donate(uint amount, uint category) public payable {
        require(msg.value == amount, "Amount must match the sent value");
        require(category <= uint(Category.Homeless), "Invalid category");

        donorBalances[msg.sender] += amount;
        categoryDonations[Category(category)] += amount;

        emit DonationReceived(msg.sender, amount, Category(category));
    }

    // Function to get total donations in a category
    function getCategoryDonations(uint category) public view returns (uint) {
        require(category <= uint(Category.Homeless), "Invalid category");
        return categoryDonations[Category(category)];
    }

    // Function to check contract balance (public)
    function getBalance() public view returns (uint) {
        return address(this).balance;
    }

    // Function to withdraw funds (only owner)
    function withdrawFunds() public {
        require(msg.sender == owner, "Only the owner can withdraw funds");
        uint balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");

        payable(owner).transfer(balance);
        emit FundsWithdrawn(owner, balance);
    }

    // Function to get donor information
    function getDonorInfo(address donor) public view returns (uint, uint) {
        return (donorBalances[donor], block.timestamp);
    }
}
